import './Home.css';
import Backgroundvideo from './../../Layout/Background/Backgroundvideo';
import Contant  from "../../Components/Contant/Contant";


const Homepage = () => {
    return (
        <div className="HomePage">
       
                    <Backgroundvideo/>
                    <Contant>
                        <h1>Have The Best With US...</h1>
                        <h2>Create your best style here...</h2>
                    </Contant>                   
             
        </div>
    )
}
export default Homepage
